import { Injectable } from '@angular/core';
import { Observable, from } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class LabSeqService {
  private baseUrl = 'http://localhost:8080/labseq';

  constructor() {}

  getLabSeqValue(n: number): Observable<number> {
    return from(
      fetch(`${this.baseUrl}/${n}`).then((response) => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.text(); // Read the response as text
      }).then((data) => {
        const parsedData = parseFloat(data);
        console.log('Response Body:', parsedData);
        return parsedData;
      })
    );
  }
}
